module.exports = "<ng-container *ngIf=\"globals.theme == 'nexgeek'\">\n\n\t<!-- SITE MAIN CONTENT -->\n\t<main class=\"main-content\">\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">Privacy & Cookie Policy</h1>\n\t\t\t<p>Wij zijn ervan bewust dat jij vertrouwen stelt in ons. Wij zien het dan ook als onze verantwoordelijkheid om de privacy te beschermen. Persoonlijke gegevens worden uitsluitend gebruikt voor de doeleinden waarvoor de gegevens verstrekt zijn. </p>\n\t\n\t\t\t<p>Dit privacybeleid is van toepassing op de diensten van Gezamenlijk Voordeel. Ben bewust dat Gezamenlijk Voordeel niet verantwoordelijk is voor het privacybeleid van andere sites en bronnen. Door gebruik te maken van deze website geef jij aan het privacybeleid te accepteren.</p>\n\t\t\t\n\t\t\t<p>\n\t\t\tBedrijfsgegevens</p>\n\t\t\t\n\t\t\t<p>Naam bedrijf Gezamenlijk Voordeel<br />\n\t\t\tWebsite www.gezamenlijkvoordeel.nl<br />\n\t\t\tInschrijfnummer KvK <br />\n\t\t\tBTW-nummer NL<br />\n\t\t\t </p>\n\t\t\t\n\t\t\t<p>Privacy- en cookiestatement<br />\n\t\t\tVoor elk(e) sitebezoek, transactie of overeenkomst op de webshops van Gezamenlijk Voordeel geldt onderstaand privacy- en cookiestatement. Dit privacy- en cookiestatement kan van tijd tot tijd worden aangepast. Op deze website is ons privacy- en cookiestatement altijd in te zien. </p>\n\t\t\t\n\t\t\t<p>Doeleinden van gebruik<br />\n\t\t\tGezamenlijk Voordeel verwerkt persoonsgegevens voor (i) de acceptatie van de bestelling, (ii) het tegengaan van overkreditering, (iii) uitvoering van overeenkomsten met jou, (iv) relatiebeheer, (v) managementinformatie, product- en dienstontwikkeling, het bepalen van de (algemene) strategie, (vi) het uitvoeren van analyses en (vii) het nakomen van wettelijke verplichtingen.</p>\n\t\t\t\n\t\t\t<p>Bij de verwerking van persoonsgegevens en de levering van haar diensten kan Gezamenlijk Voordeel groepsvennootschappen, samenwerkende partners en eventuele (sub)bewerker(s) inschakelen.</p>\n\t\t\t\n\t\t\t<p>Persoonsgegevens kunnen ook worden gebruikt voor het opsporen van (pogingen tot) onrechtmatige en/of strafbare gedragingen gericht tegen Gezamenlijk Voordeel, haar klanten en medewerkers, alsmede voor deelname aan waarschuwingssystemen welke worden gebruikt ter voorkoming van fraude en overkreditering.</p>\n\t\t\t\n\t\t\t<p>Communicatie<br />\n\t\t\tPersoonsgegevens kunnen worden gebruikt om al dan niet op basis van een voorafgaande selectie te informeren over interessante gelijksoortige aanbiedingen en producten of diensten van Gezamenlijk Voordeel en/of groepsvennootschappen en samenwerkende partners. Informatie voortvloeiende uit de tussen jou en Gezamenlijk Voordeel bestaande overeenkomst kun je per e-mail ontvangen. Commerci&euml;le informatie is ook per e-mail te ontvangen, mits hiervoor toestemming gegeven is.</p>\n\t\t\t\n\t\t\t<p>Nieuwsbrief<br />\n\t\t\tWij bieden een nieuwsbrief waarmee wij ge&iuml;nteresseerden willen informeren over onze producten en/ of diensten. Deze nieuwsbrief wordt enkel ontvangen indien hiervoor toestemming gegeven is. Een inschrijving voor onze nieuwsbrief kan er tevens toe leiden dat je incidenteel benaderd wordt om vrijwillig deel te nemen aan een consumentenonderzoek.</p>\n\t\t\t\n\t\t\t<p>Uitschrijven dienst nieuwsbrief<br />\n\t\t\tOnderaan onze nieuwsbrieven wordt een afmeldmogelijkheid opgenomen.</p>\n\t\t\t\n\t\t\t<p>Aanpassen/ uitschrijven communicatie<br />\n\t\t\tAls jij geen commerci&euml;le informatie (meer) wenst te ontvangen, of niet wilt dat persoonsgegevens worden gebruikt voor direct marketing doeleinden, maak dit dan kenbaar aan de betreffende vennootschap. Contact opnemen met Gezamenlijk Voordeel kan via telefoon op +31 (0)73 611 01 51, een brief naar Afdeling Klantenservice, De Tweeling 24a, 5215 MC 's-Hertogenbosch, of stuur een e-mail naar info@outofthebox.nl. </p>\n\t\t\t\n\t\t\t<p>Door de algemene voorwaarden zoals deze worden gehanteerd door Gezamenlijk Voordeel te aanvaarden stem jij tevens in met de mogelijkheid dat (i) Gezamenlijk Voordeel persoonsgegevens (laat) gebruiken voor credit scoring en (ii) Gezamenlijk Voordeel informatie over je kredietwaardigheid verstrekt aan BKR. </p>\n\t\t\t\n\t\t\t<p>Om afhandeling van klachten en serviceverlening mogelijk te maken kan Gezamenlijk Voordeel gegevens van jou die daarvoor noodzakelijk zijn verstrekken aan leveranciers of andere partijen waar Gezamenlijk Voordeel mee samenwerkt in het kader van klachtafhandeling en serviceverlening. </p>\n\t\t\t\n\t\t\t<p>Gezamenlijk Voordeel gebruikt persoonsgegevens niet voor adressenhandel.</p>\n\t\t\t\n\t\t\t<p>Cookies<br />\n\t\t\tCookies zijn kleine tekstbestanden of andere technieken waarmee bij een bezoek aan een website informatie op het apparaat wordt geplaatst. Zowel Gezamenlijk Voordeel als andere partijen kunnen cookies plaatsen. Met behulp van de cookies kan er onder meer voor worden gezorgd dat jij bij een bezoek aan onze site niet herhaaldelijk dezelfde informatie ontvangt of moet invoeren. Cookies worden niet gebruikt om priv&eacute;gegevens van het apparaat te halen of wachtwoorden te achterhalen.</p>\n\t\t\t\n\t\t\t<p>Er bestaan verschillende soorten cookies. Op de website is een overzicht waarin (i) de gebruikte cookies worden opgesomd (ii) wie het cookie plaatst (Gezamenlijk Voordeel of een derde partij met een link naar de website van de derde partij) (iii) het doel van het betreffende cookie en (iv) de bewaartermijn.</p>\n\t\t\t\n\t\t\t<p>De meeste browsers kunnen zodanig worden ingesteld dat cookies niet geaccepteerd worden of dat jij op de hoogte wordt gesteld wanneer je een cookie ontvangt. Instructies met betrekking tot het aanpassen van de instellingen van de browser vind je onder &lsquo;Help&rsquo; in de toolbar van de meeste browsers. Hoewel de bezoeker van de site de site nog steeds kan bezoeken is het echter mogelijk dat als cookies niet worden geaccepteerd, bepaalde diensten of elementen van de site niet optimaal functioneren. Het niet accepteren van cookies beperkt het gebruik van onze site en diensten.</p>\n\t\t\t\n\t\t\t<p>De veiligheid van persoonsgegevens<br />\n\t\t\tWij hebben passende technische en organisatorische maatregelen genomen om persoonsgegevens te beveiligen tegen verlies, of tegen enige vorm van onrechtmatige verwerking.</p>\n\t\t\t\n\t\t\t<p>Rechten<br />\n\t\t\tJe mag ons inzage verzoeken in persoonsgegevens. Ook kan ons verzocht worden persoonsgegevens te verbeteren, aan te vullen, te verwijderen of af te schermen indien deze onjuist, onvolledig of irrelevant zijn, of anderszins in strijd met een wettelijk voorschrift worden verwerkt.</p>\n\t\t</div>\n\t</main>\n\n</ng-container>\n\n<ng-container *ngIf=\"globals.theme == 'mogo'\">\n\n\t\n\t<main>\n\n\t    <div class=\"tt-layout tt-sticky-block__parent tt-layout__fullwidth\">\n\t        <div class=\"tt-layout__content\">\n\t            <div class=\"container\">\n\t\n\t                <div class=\"tt-page__name text-center\">\n\t                    <h1>Privacy & Cookie Policy</h1>\n\t                    <p></p>\n\t                </div>\n\t\n\t                <div class=\"ttg-mt--40\">\n\t                    <div style=\"max-height: 350px; display: flex; align-items: center; overflow: hidden;\">\n\t                        <img src=\"assets/templates/mogo/images/services/cookie-01.jpg\" alt=\"\">\n\t                    </div>\n\t                </div>\n\t\t\t\t\t\n\t\t\t\t\t<div class=\"tt-page__name-sm ttg-mt--90\">\n\t\t\t\t\t\t<p>Wij zijn ervan bewust dat jij vertrouwen stelt in ons. Wij zien het dan ook als onze verantwoordelijkheid om de privacy te beschermen. Persoonlijke gegevens worden uitsluitend gebruikt voor de doeleinden waarvoor de gegevens verstrekt zijn. </p>\n\t\n\t\t\t\t\t\t<p>Dit privacybeleid is van toepassing op de diensten van Gezamenlijk Voordeel. Ben bewust dat Gezamenlijk Voordeel niet verantwoordelijk is voor het privacybeleid van andere sites en bronnen. Door gebruik te maken van deze website geef jij aan het privacybeleid te accepteren.</p>\n\t\t\t\t\t\t\n            <p><strong>Privacy- en cookiestatement</strong><br />\n\t\t\t\t\t\tVoor elk(e) sitebezoek, transactie of overeenkomst op de webshops van Gezamenlijk Voordeel geldt onderstaand privacy- en cookiestatement. Dit privacy- en cookiestatement kan van tijd tot tijd worden aangepast. Op deze website is ons privacy- en cookiestatement altijd in te zien. </p>\n\t\t\t\t\t\t\n            <p><strong>Doeleinden van gebruik</strong><br />\n\t\t\t\t\t\tGezamenlijk Voordeel verwerkt persoonsgegevens voor (i) de acceptatie van de bestelling, (ii) het tegengaan van overkreditering, (iii) uitvoering van overeenkomsten met jou, (iv) relatiebeheer, (v) managementinformatie, product- en dienstontwikkeling, het bepalen van de (algemene) strategie, (vi) het uitvoeren van analyses en (vii) het nakomen van wettelijke verplichtingen.</p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p>Bij de verwerking van persoonsgegevens en de levering van haar diensten kan Gezamenlijk Voordeel groepsvennootschappen, samenwerkende partners en eventuele (sub)bewerker(s) inschakelen.</p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p>Persoonsgegevens kunnen ook worden gebruikt voor het opsporen van (pogingen tot) onrechtmatige en/of strafbare gedragingen gericht tegen Gezamenlijk Voordeel, haar klanten en medewerkers, alsmede voor deelname aan waarschuwingssystemen welke worden gebruikt ter voorkoming van fraude en overkreditering.</p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p><strong>Communicatie</strong><br />\n\t\t\t\t\t\tPersoonsgegevens kunnen worden gebruikt om al dan niet op basis van een voorafgaande selectie te informeren over interessante gelijksoortige aanbiedingen en producten of diensten van Gezamenlijk Voordeel en/of groepsvennootschappen en samenwerkende partners. Informatie voortvloeiende uit de tussen jou en Gezamenlijk Voordeel bestaande overeenkomst kun je per e-mail ontvangen. Commerci&euml;le informatie is ook per e-mail te ontvangen, mits hiervoor toestemming gegeven is.</p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p><strong>Nieuwsbrief</strong><br />\n\t\t\t\t\t\tWij bieden een nieuwsbrief waarmee wij ge&iuml;nteresseerden willen informeren over onze producten en/ of diensten. Deze nieuwsbrief wordt enkel ontvangen indien hiervoor toestemming gegeven is. Een inschrijving voor onze nieuwsbrief kan er tevens toe leiden dat je incidenteel benaderd wordt om vrijwillig deel te nemen aan een consumentenonderzoek.</p>\n\t\t\t\t\t\t\n            <p><strong>Uitschrijven dienst nieuwsbrief</strong><br />\n\t\t\t\t\t\tOnderaan onze nieuwsbrieven wordt een afmeldmogelijkheid opgenomen.</p>\n\t\t\t\t\t\t\n            <p><strong>Aanpassen/ uitschrijven communicatie</strong><br />\n\t\t\t\t\t\tAls jij geen commerci&euml;le informatie (meer) wenst te ontvangen, of niet wilt dat persoonsgegevens worden gebruikt voor direct marketing doeleinden, maak dit dan kenbaar aan de betreffende vennootschap. Contact opnemen met Gezamenlijk Voordeel kan via telefoon op +31 (0)73 611 01 51, een brief naar Afdeling Klantenservice, De Tweeling 24a, 5215 MC 's-Hertogenbosch, of stuur een e-mail naar info@outofthebox.nl. </p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p>Door de algemene voorwaarden zoals deze worden gehanteerd door Gezamenlijk Voordeel te aanvaarden stem jij tevens in met de mogelijkheid dat (i) Gezamenlijk Voordeel persoonsgegevens (laat) gebruiken voor credit scoring en (ii) Gezamenlijk Voordeel informatie over je kredietwaardigheid verstrekt aan BKR. </p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p>Om afhandeling van klachten en serviceverlening mogelijk te maken kan Gezamenlijk Voordeel gegevens van jou die daarvoor noodzakelijk zijn verstrekken aan leveranciers of andere partijen waar Gezamenlijk Voordeel mee samenwerkt in het kader van klachtafhandeling en serviceverlening. </p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p>Gezamenlijk Voordeel gebruikt persoonsgegevens niet voor adressenhandel.</p>\n\t\t\t\t\t\t\n            <p><strong>Cookies</strong><br />\n\t\t\t\t\t\tCookies zijn kleine tekstbestanden of andere technieken waarmee bij een bezoek aan een website informatie op het apparaat wordt geplaatst. Zowel Gezamenlijk Voordeel als andere partijen kunnen cookies plaatsen. Met behulp van de cookies kan er onder meer voor worden gezorgd dat jij bij een bezoek aan onze site niet herhaaldelijk dezelfde informatie ontvangt of moet invoeren. Cookies worden niet gebruikt om priv&eacute;gegevens van het apparaat te halen of wachtwoorden te achterhalen.</p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p>Er bestaan verschillende soorten cookies. Op de website is een overzicht waarin (i) de gebruikte cookies worden opgesomd (ii) wie het cookie plaatst (Gezamenlijk Voordeel of een derde partij met een link naar de website van de derde partij) (iii) het doel van het betreffende cookie en (iv) de bewaartermijn.</p>\n\t\t\t\t\t\t\n\t\t\t\t\t\t<p>De meeste browsers kunnen zodanig worden ingesteld dat cookies niet geaccepteerd worden of dat jij op de hoogte wordt gesteld wanneer je een cookie ontvangt. Instructies met betrekking tot het aanpassen van de instellingen van de browser vind je onder &lsquo;Help&rsquo; in de toolbar van de meeste browsers. Hoewel de bezoeker van de site de site nog steeds kan bezoeken is het echter mogelijk dat als cookies niet worden geaccepteerd, bepaalde diensten of elementen van de site niet optimaal functioneren. Het niet accepteren van cookies beperkt het gebruik van onze site en diensten.</p>\n\t\t\t\t\t\t\n            <p><strong>De veiligheid van persoonsgegevens</strong><br />\n\t\t\t\t\t\tWij hebben passende technische en organisatorische maatregelen genomen om persoonsgegevens te beveiligen tegen verlies, of tegen enige vorm van onrechtmatige verwerking.</p>\n\t\t\t\t\t\t\n            <p><strong>Rechten</strong><br />\n\t\t\t\t\t\tJe mag ons inzage verzoeken in persoonsgegevens. Ook kan ons verzocht worden persoonsgegevens te verbeteren, aan te vullen, te verwijderen of af te schermen indien deze onjuist, onvolledig of irrelevant zijn, of anderszins in strijd met een wettelijk voorschrift worden verwerkt.</p>\n\t                </div>\n\t\t\t\t</div>\n\t        </div>\n\t    </div>\n\t\n\t</main>\n\t\n\n</ng-container>\n"

