module.exports = "<ng-container *ngIf=\"globals.theme == 'nexgeek'\">\n\n\t<!-- SITE MAIN CONTENT -->\n\t<main class=\"main-content\">\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">Verzending & Bezorging</h1>\n\t\t\t<p>Vóór 19:00 uur besteld? Morgen in huis!</p> \n\t\t\t<p>\n\t\t\t\tProducten die bij ons op voorraad zijn én op werkdagen vóór 19:00 uur zijn besteld, worden de eerstvolgende dag geleverd! Bestellingen geplaatst in het weekend worden op dinsdag bezorgd.\n\t\t\t\tIn onze webshop is gemakkelijk te zien of het gewenste product op voorraad is. Indien een product momenteel niet voorradig is, wordt deze besteld bij onze leverancier en binnen 5 tot 10 werkdagen geleverd.\n\t\t\t\t<br/>\n\t\t\t\tWij verzorgen de verzending met PostNL.\n\t\t\t</p>\n\t\t</div>\n\t</main>\n\n</ng-container>\n\n<ng-container *ngIf=\"globals.theme == 'mogo'\">\n\n\t\n\t<main>\n\n\t    <div class=\"tt-layout tt-sticky-block__parent tt-layout__fullwidth\">\n\t        <div class=\"tt-layout__content\">\n\t            <div class=\"container\">\n\t\n\t                <div class=\"tt-page__name text-center\">\n\t                    <h1>Verzending & Bezorging</h1>\n\t                    <p>Alle informatie over de verzending en bezorging van een bestelling</p>\n\t                </div>\n\t\n\t                <div class=\"ttg-mt--40\">\n\t                    <div style=\"max-height: 350px; display: flex; align-items: center;  overflow: hidden;\">\n\t                        <img src=\"assets/templates/mogo/images/services/shipment-01.jpg\" alt=\"\">\n\t                    </div>\n\t                </div>\n\t\t\t\t\t\n\t\t\t\t\t<div class=\"tt-page__name-sm ttg-mt--90\">\n\t\t\t\t\t\t<h4>Vóór 22:00 uur besteld? Morgen in huis!</h4>\n\t\t\t\t\t\t<br />\n\t\t\t\t\t\t<p>\n\t\t\t\t\t\t\tProducten die bij ons op voorraad zijn én op werkdagen vóór 22:00 uur zijn besteld, worden de eerstvolgende dag geleverd! Bestellingen geplaatst in het weekend worden op dinsdag bezorgd.\n\t\t\t\t\t\t\tIndien een product momenteel niet voorradig is, wordt deze besteld bij onze leverancier en binnen 5 tot 10 werkdagen geleverd. Wij nemen dan contact met je op.\n\t\t\t\t\t\t</p>\n\t                </div>\n\t\t\t\t\t\n\t                <!-- <div class=\"row ttg-grid-padding--none\">\n\t                    <div class=\"col-sm-6\">\n\t                        <div class=\"ttg-image-translate--left\">\n\t                            <img src=\"assets/templates/mogo/images/services/services-02.jpg\" alt=\"Image name\">\n\t                        </div>\n\t                    </div>\n\t                    <div class=\"col-sm-6\">\n\t                        <div class=\"ttg-image-translate--top\">\n\t                            <img src=\"assets/templates/mogo/images/services/services-03.jpg\" alt=\"Image name\">\n\t                        </div>\n\t                    </div>\n\t                </div> -->\n\t\t\t\t</div>\n\t        </div>\n\t    </div>\n\t\n\t</main>\n\t\n\n</ng-container>\n"

